import React from 'react';
import Alisson from "./images/ali.jpeg"


class Card extends React.Component {
    render() {
      return (
        <div className="card">
        <div>
        <img src={Alisson} alt="alisson" height="500px" width="500px"/>
        <button className="far fa-heart">

        </button>
        </div>
        </div>

      )
    }
  }
  export default Card;
